import React from "react";
import { useState } from "react";
import Msg from "./Components/Msg";
import { useEffect } from "react";
const msg = [
  {
    id: 1,
    attributes: {
      name: "孙悟空",
      gender: "男",
      age: 18,
      address: "花果山",
    },
  },
  {
    id: 2,
    attributes: {
      name: "猪八戒",
      gender: "男",
      age: 28,
      address: "高老庄",
    },
  },
  {
    id: 3,
    attributes: {
      name: "沙和尚",
      gender: "男",
      age: 38,
      address: "流沙河",
    },
  },
];
const App = () => {
  const [data, setData] = useState(msg);
  useEffect(() => {
    fetch("http://localhost:1337/api/students").then((res) => {
      res.json()
    });
  }, []);
  return (
    <div>
      <ul>
        {data.map((item) => (
          <Msg key={item.id} stu={item.attributes} />
        ))}
      </ul>
    </div>
  );
};

export default App;
